import React from 'react';

const Card = ({onRouteChange}) => {
  return  (

<div className='col'>
	<div class="card cardCities">
		<div class="card-image">
			<img alt='city' src="https://www.urbanarts.com.br/imagens/produtos/026863/0/Ampliada/paisagem.jpg" />    
			<a class="btn-floating halfway-fab waves-effect waves-light orange"><i class="material-icons">add</i></a>
	   	</div>
	    <span class="card-title">Card Title</span>
	    <div class="card-content">
	    	<p onClick={() => onRouteChange('review')} className='pointer'>Go to review</p>
	        <i class="material-icons tiny">star</i>
	        <i class="material-icons tiny">star</i>
	        <i class="material-icons tiny">star</i>
	        <i class="material-icons tiny">star_half</i>
	        <i class="material-icons tiny">star_border</i>
	    </div>
	</div>
</div>
	);
}

export default Card;
